import './pageTitle.css';

function PageTitle() {
  return (
    <div className='pagetitle'>
        <h1> Dashboard</h1>
        <nav>
            <ol className='breadcrumb'>
                <li className='breadcrumb-item'>
                    
                </li>
            </ol>
        </nav>
    </div>
  )
}

export default PageTitle
